import { motion } from "framer-motion";
import styled from "styled-components";

const NavbarCompopentsStyle = styled(motion.div)`
  position: fixed;
  height: 50px;
  width: 90vw;
  padding: 0 5vw 0 5vw;
  z-index: 10000;
  font-size: 18px;
  display: flex;
  justify-content: space-between;
  align-items: center;
  background-color: #19191999;
  backdrop-filter: blur(101px);
  .logo {
    width: 60%;
    font-size: 24px;
    color: #f2c14e;
  }
  .home {
    color: #c1c0c4;
  }
`;

const NavbarComponent = () => {
  return (
    <NavbarCompopentsStyle>
      <span className="logo"> DeepEnd </span>
      <span className="home"> home </span>
      <span className="home"> home </span>
      <span className="home"> home </span>
      <span className="home"> home </span>
      <span className="home"> home </span>
    </NavbarCompopentsStyle>
  );
};

export default NavbarComponent;
